import MODAL_TYPE_ENUM from "common/enumerators/ModalTypeEnum";

export default function Plate({ plate, toggleModal}) {

    const openVehicleModal = () => {
     toggleModal(MODAL_TYPE_ENUM.VEHICLE, plate);
    }

    return (
      <>
        <div
          className={plate !== "..." && "underlined_text"}
          onClick={openVehicleModal}
          style={{ textAlign: 'center', cursor: plate !== "..." && "pointer", color: '#2322c8' }}
        >
          {plate}
        </div>
      </>
    )
  }
